  render() {
    return (
      <div>
        <h2>Search Movies</h2>

          <img className="action-buttons" src={deleteImage} alt="delete" />
                <div className="movie">
          Movie Image Goes Here
        </div>

          <img className="action-buttons" src={approveImage} alt="delete" />

      </div>
    );
  }
}

export default SearchMovies;
